import React, {Component} from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import logo from '../images/logo.png';
import '../css/KM.css'
import Card from 'react-bootstrap/Card';

const info = [
    {
        titel: "Klubbmästare",
        namn: "Oliver Jensen",
        img: null
    },
    {
        titel: "Vice Klubbmästare",
        namn: "Johan Widmark",
        img: null
    },
    {
        titel: "Pubmästare",
        namn: "Adam Henriksson",
        img: null
    },
    {
        titel: "Marsall",
        namn: "",
        img: null
    },
    {
        titel: "Marsall",
        namn: "",
        img: null
    }
];



class KM extends Component {
    render(){
        let contentLength = 0;
        const content = info.forEach((person, i) => {
            console.log("person",person)
            contentLength = i;
            return (
                <Col sm key={"col_" + i}>
                    <Card bg="dark">
                        <Card.Header>{person.title}</Card.Header>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title>{person.name}</Card.Title>
                        </Card.Body>
                    </Card>
                </Col>
            )
        });

        console.log("Length", contentLength);
        return (content);
    }

